import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Amazon from "./AmaZ";
import Net from "./Net";

const fev="Netflix";
function B(){
    if(fev==="Netflix"){
         return <Net/> ;
    }else{
      return  <Amazon/>;
    }
}

ReactDOM.render(
    <>
      {/* <B/> */}
      {fev==="Netflix"? <Net/>:<Amazon/>}
    </>,document.getElementById("root")
)
